import React, { FC } from 'react'
import { useAppSelector } from '../hook'

export const Activity:FC = () => {
    const boreds = useAppSelector(state => state.card.card)

  return (
    <div>
       {boreds.map(item => 
        <div key={item.key}>
            <h2>{item.accessibility}</h2>
            <p>
                Type: {item.type}<br />
                Participants: {item.participants} <br />
                Price: {item.price}
            </p>

        </div>
        )}
    </div>
  )
}
